import UpcomingRaces from './UpcomingRaces';
import Home from './Home';
import './Navbar.css';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import React, { useEffect, useState } from "react";
import MyProfile from './MyProfile';
import Teams from './Teams';
import NewTeam from './NewTeam';
const Navbar
    = () => {

        const [isLoggedIn, setIsLoggedIn] = useState(false)

        async function checkLoggedIn() {
            let restURL = "http://localhost:8081/race/rest/users/isLoggedIn";
            await fetch(restURL, {
                method: "GET",
                credentials: 'include',
                headers: {
                    mode: 'no-cors',
                    'Content-Type': 'application/json',
                }
            })
                .then(response => {
                    return response.json()
                })
                .then(data => {
                    setIsLoggedIn(data);
                })
        }
        useEffect(() => {
            checkLoggedIn();
        }, [])


        if(isLoggedIn){
            return (
                <Router>
                    <div className="Navbar">
                        <div className="links">
                            <Link to="/">Home</Link>
                            <Link to="/upcomingRaces">Upcoming Races</Link>
                            <Link to="/myraces">My Races</Link>
                            <Link to="/teams">Teams</Link>
                            <Link to="/garage">Garage</Link>
                            <Link to="/myprofile">My Profile</Link>
                        </div>
                    </div>
                    <div className="navContain">
                        <Routes>
                            <Route exact path="/" element={<Home />} />
                            <Route path="/upcomingraces" element={<UpcomingRaces />} />
                            <Route path="/myprofile" element={<MyProfile />} />
                            <Route path="/teams" element={<Teams />} />
                            <Route path="/newTeam" element={<NewTeam />} />
                        </Routes>
                    </div>
                </Router>
            );
        }
        
    }

export default Navbar;
